### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Data Sanity and Validation**
   - Identifying incorrect data types, invalid dates, and out-of-range values.
   - Example: Identifying rows with mistakes in the "Scores" dataset.

2. **Pseudocode Analysis and Execution**
   - Understanding and analyzing pseudocode to determine its functionality.
   - Example: Analyzing the `DoSomething` procedure to understand its return values.

3. **Data Processing and Counting**
   - Counting specific data entries based on given conditions.
   - Example: Counting the number of nouns with a specific letter count range.

4. **Conditional Logic and Loops**
   - Using conditional statements and loops to process data.
   - Example: Using `if` statements and `while` loops to iterate through datasets.

5. **Data Structures and Tables**
   - Moving data between tables and processing rows.
   - Example: Moving rows from Table 1 to Table 2 and vice versa.

6. **Mathematical Operations**
   - Performing mathematical operations like sums, averages, and comparisons.
   - Example: Calculating the average letter count and comparing it with individual sentence averages.

7. **String Manipulation**
   - Checking string properties like letter count, starting/ending characters.
   - Example: Checking if a word starts with 's' and ends with a full stop.

8. **Conjugate Words**
   - Identifying conjugate words based on vowel and consonant counts.
   - Example: Checking if two words have the same number of vowels but different consonant counts.

9. **Procedure and Function Calls**
   - Defining and calling procedures/functions to perform specific tasks.
   - Example: Calling `findPair(X, Y)` to check if two rows meet specific criteria.

#### Important Equations and Logic

1. **Sum and Average Calculations**
   - Sum: \( \text{Sum} = \text{Sum} + \text{value} \)
   - Average: \( \text{Average} = \frac{\text{Sum}}{\text{Count}} \)

2. **Conditional Logic**
   - If-Else Statements:
     ```plaintext
     if (condition) {
         // code to execute if condition is true
     } else {
         // code to execute if condition is false
     }
     ```

3. **Loop Structures**
   - While Loops:
     ```plaintext
     while (condition) {
         // code to execute while condition is true
     }
     ```

4. **Counting Logic**
   - Incrementing Count:
     ```plaintext
     if (condition) {
         count = count + 1
     }
     ```

5. **String Manipulation Logic**
   - Checking String Properties:
     ```plaintext
     if (X.word starts with 's' and X.word ends with full stop) {
         count = count + 1
     }
     ```

6. **Conjugate Words Logic**
   - Checking Vowel and Consonant Counts:
     ```plaintext
     if (vCount(X) == vCount(Y) and (X.LetterCount - vCount(X) != Y.LetterCount - vCount(Y))) {
         count = count + 1
     }
     ```

